import React, {Component} from 'react';
import {
    View,
    KeyboardAvoidingView,
    TextInput,
    StyleSheet,
    Text,
    Platform,
    TouchableWithoutFeedback,
    Button,
    Keyboard,
    SafeAreaView,
    FlatList
} from 'react-native';
import MyButton from "./MyButton";
import User from './User'

export default class extends Component {
    render() {
        const data = this.props.route.params.users
        console.log(data)
        const renderItem = ({item}) =>(<User name={item.username} password={item.password} date={item.date} id={item.id} navigate={this.props.navigation}/>)
        return (
            <SafeAreaView style={{flex:1}}>
                <FlatList
                    data={data}
                    renderItem={renderItem}
                    keyExtractor={item => item.id.toString()}
                />
            </SafeAreaView>
        )
            ;
    }
}
